import { List } from "antd";

const InternshipPost = (props) => {
  const { post } = props;
  const { title, id } = post;

  return (
    <List.Item key={id}>
      <List.Item.Meta title={title} />
      <div>Content</div>
    </List.Item>
  );
};

export default InternshipPost;
